import React from "react";

type InputProps = {
  placeholder: string;
  type: string;
  name: string;
  style?: any;
};

export default function Input({ type, placeholder, name, style }: InputProps) {
  return (
    <input name={name} type={type} placeholder={placeholder} style={style} />
  );
}
